import React from 'react';
import sdata from './Sdata';
import Cards from './cards'

const favS = 'amazon';

function Series() {

    if (favS === 'netflix') {
        return (
            <Cards
                imgsrc={sdata[1].imgsrc}
                title={sdata[1].title}
                sname={sdata[1].sname}
                links={sdata[1].links}
            />
        )
    }
    else {
        return (
            <Cards
                imgsrc={sdata[2].imgsrc}
                title={sdata[2].title}
                sname={sdata[2].sname}
                links={sdata[2].links}
            />
        )
    }
}

const App = () => (
    <>
        <h1 className="heading">List of Best Five Netflix Webseries</h1>
        <Series />
    </>
);

export default App;
